import React, { useEffect, useState } from "react";
import LoadingBar from "../LoadingBar/LoadingBar";
import "./Test.css";

function Test() {
  const [barPercentage, setbarPercentage] = useState(2000);

  return (
    <div className="test" id="isprobaj">
      <div className="test__wrapper">
        <h1>Temperature</h1>
        <LoadingBar
          min_progress="0"
          max_progress="6000"
          title="Temperature"
          done={barPercentage}
        />
      </div>
      <div className="test__wrapper">
        <h1>Temperature</h1>
        <LoadingBar
          min_progress="0"
          max_progress="6000"
          title="Temperature"
          done={barPercentage}
        />
      </div>
      <div className="test__wrapper">
        <h1>Temperature</h1>
        <LoadingBar
          min_progress="0"
          max_progress="6000"
          title="Temperature"
          done={barPercentage}
        />
      </div>
    </div>
  );
}

export default Test;
